import About from "./components/About.js"
import Menu from "./menu";

const Home: React.FC = () => {
    return (
        <div>
            <Menu />
            <Intro />

            <div id="about" />
            <About />

            <div id="worked" />
            <Worked />
        </div>
    );
};

export default Home;
